INSERT INTO `ic_contenido` (`pg_id`, `l_lang`, `pg_titulo`, `pg_conten`, `pg_creacion`, `pg_imprimir`, `pg_tag_titulo`, `pg_tag_desc`, `pg_tag_key`) VALUES
(1, '_en', 'HOME-INTRO', '<p style=\"text-align: left;\"><span style=\"color: #ff9900;\"><strong>&iquest;Queres expandir tu Negocio?</strong>&nbsp;</span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #ff9900;\">&nbsp; &nbsp; &nbsp; &nbsp;</span><strong><span style=\"color: #808080;\">&iexcl;Ahora es m&aacute;s Simple!</span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"color: #808080;\"><br /></span></strong></p>\r\n<p><span style=\"font-size: medium; color: #800080;\"><strong><em class=\"fa fa-check-square-o\" style=\"font-size: 22px; color: #ff9900;\"></em> &iexcl;Gana Dinero! </strong>Ofreciendo servicios profesionales matriculados.</span></p>\r\n<p><span style=\"font-size: medium; color: #800080;\"><br /></span></p>\r\n<p><span style=\"font-size: medium; color: #800080;\"><em class=\"fa fa-check-square-o\" style=\"font-size: 22px; color: #ff9900;\"></em> Ahorra tiempo y Genera&nbsp;<strong>Nuevos Clientes.</strong></span></p>\r\n<p><span style=\"font-size: medium; color: #800080;\"><strong><br /></strong></span></p>\r\n<p><span style=\"font-size: medium; color: #800080;\"><em class=\"fa fa-check-square-o\" style=\"font-size: 22px; color: #ff9900;\"></em> Alcanza resultados de manera&nbsp;<strong>R&aacute;pida y Sencilla.</strong></span></p>', '2018-08-12', 0, '', '', ''),
(2, '_en', 'Mundo WORKLife', '<p align=\"center\"><span style=\"color: #888888;\"><strong>Bienvenidos </strong></span></p>\r\n<p align=\"center\"><span style=\"color: #888888;\"><strong>al Mundo WORKLife</strong></span></p>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"color: #888888;\"><strong>WORKLife</strong>&nbsp;funciona como una gran Red Colaborativa de Servicios. Las personas pueden Encontr&aacute;r y Publicar servicios con un simple registro en el sitio.</span></p>\r\n<p class=\"ecxmsonormal\"><span style=\"color: #888888;\"><strong>WORKLife</strong>&nbsp;se cre&oacute; inspirado en aquellas personas que poseen un oficio, una profesi&oacute;n, o una vocaci&oacute;n, con el fin de ayudarlos a ampliar su cartera de clientes.</span></p>', '2018-08-08', 0, '', '', ''),
(5, '_en', 'Cuentas Premium', '<p style=\"text-align: center;\"><span style=\"color: #808080;\"><span style=\"color: #ff9900;\"><strong>Cuenta Premium</strong></span></span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #808080;\"><strong>WORKLife</strong> tiene multiples Beneficios para ti!</span></p>\r\n<p><span style=\"color: #808080;\">Permitir&aacute; mostrar tu Servicio&nbsp;<strong>Primero </strong>ayudandote a que te encuentren mas F&aacute;cil y asi obtener&nbsp;mejores <strong>Resultados;</strong>&nbsp;Garantizando el Aumento de</span><span style=\"color: #808080;\">&nbsp;nuevas </span><strong style=\"color: #808080;\">Cotizaciones.</strong></p>\r\n<p><span style=\"text-align: center; color: #888888;\">- Alcanzar </span><strong style=\"text-align: center; color: #888888;\">Resultados</strong><span style=\"text-align: center; color: #888888;\"> de manera Rapida y Sencilla.</span></p>\r\n<p><span style=\"color: #888888;\"><strong>- Ganar Dinero</strong>&nbsp;ofreciendo servicios profesionales, acad&eacute;micos y matriculados.</span></p>\r\n<p><span style=\"color: #888888;\"><strong>- Ahorrar tiempo</strong> y generar nuevos clientes.</span></p>', '2018-08-08', 0, '', '', ''),
(7, '_en', 'Politicas de Privacidad', '<p><strong>Pol&iacute;ticas de privacidad y confidencialidad de la informaci&oacute;n</strong></p>\r\n<p>Estas pol&iacute;ticas de privacidad entrar&aacute;n en vigor desde su aceptaci&oacute;n para los nuevos usuarios y est&aacute;n vigentes desde el 1 de abril de 2015.</p>\r\n<p>La privacidad de la informaci&oacute;n de los usuarios es muy importante para&nbsp;<strong><em>WORKLIFE</em></strong>. Es por esta raz &oacute;n que se toman las precauciones y recaudos para resguardar su informaci &oacute;n, utilizando los mecanismos de seguridad inform&aacute;tica de protecci &oacute;n de la informaci &oacute;n m&aacute;s completos y eficaces.</p>\r\n<p>Este documento es parte integrante de los&nbsp;<a href=\"wl/web/footerTerminosCondiciones.xhtml\">T&eacute;rminos y Condiciones Generales&nbsp;</a>de&nbsp;<strong><em>WORKLIFE</em></strong>. Mediante la aceptaci &oacute;n de los&nbsp;<a href=\"wl/web/footerTerminosCondiciones.xhtml\">T&eacute;rminos y Condiciones Generales&nbsp;</a>en el momento de la registraci &oacute;n el usuario acepta las pol&iacute;ticas aqu&iacute; contenidas.</p>\r\n<p><br /> <strong><span style=\"text-decoration: underline;\">Menores de edad (18 a&ntilde;os) - Pol&iacute;tica de privacidad</span></strong></p>\r\n<p>Nuestros servicios s &oacute;lo est&aacute;n disponibles para aquellas personas que tengan capacidad legal para contratar. Por lo tanto, aquellos que no cumplan con esta condici &oacute;n deber&aacute;n abstenerse de suministrar informaci &oacute;n personal para ser incluida en nuestras bases de datos. Sin embargo, pueden hacerlo a trav&eacute;s de los padres o tutores.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Informaci &oacute;n recopilada</span></strong></p>\r\n<p>Para utilizar el servicio de&nbsp;<strong><em>Worklife</em></strong>&nbsp;la persona que ingrese debe registrarse, suministrando ciertos datos personales, (ver plantilla de registro), estos datos deben ser completos y exactos.&nbsp;<strong><em>Worklife</em></strong>&nbsp;podr&aacute; confirmar los datos suministrados acudiendo a entidades p&uacute;blicas, compa&ntilde;&iacute;as especializadas, centrales de riesgos, entre otras, para lo cual nos autorizas expresamente.</p>\r\n<p>El usuario podr&aacute; iniciar sesi &oacute;n en&nbsp;<strong><em>Worklife</em></strong>&nbsp;con su usuario de Facebook.com. Si lo hace, nos autoriza a utilizar cierta informaci &oacute;n de su cuenta de Facebook.com, incluyendo pero no limitando a su perfil de Facebook p&uacute;blico y la informaci &oacute;n acerca de los amigos de Facebook que podr&iacute;a compartir en com&uacute;n con otros usuarios de&nbsp;<strong><em>Worklife</em></strong>.</p>\r\n<p>El usuario que se registre en&nbsp;<strong><em>Worklife</em></strong>&nbsp;de cualquier modo, consiste expresamente que&nbsp;<strong><em>Worklife&nbsp;</em></strong>podr&aacute;:</p>\r\n<ul>\r\n<li>Tenga acceso, en cualquier momento, a la totalidad de la informaci &oacute;n contenida en su cuenta personal, incluyendo en particular, pero sin limitaci &oacute;n, a su informaci &oacute;n personal, informaci &oacute;n sobre sus intereses, gustos, contacto y cualquier otro contenido alojado en su cuenta personal.</li>\r\n<li>Env&iacute;e al correo electr &oacute;nico del usuario vinculado a la cuenta personal informaci &oacute;n, mensajes, etc, con la finalidad de brindar informaci &oacute;n al usuario sobre&nbsp;<strong><em>Worklife</em></strong>.</li>\r\n</ul>\r\n<p><strong><em>Worklife</em></strong>&nbsp;recoge y almacena autom&aacute;ticamente cierta informaci &oacute;n sobre la actividad de los usuarios y visitantes dentro de su sitio web. Tal informaci &oacute;n puede incluir la URL de la que provienen (est&eacute;n o no en nuestro sitio web), a que URL acceden seguidamente (est&eacute;n o no en nuestro sitio web), que navegador est&aacute;n usando y sus direcciones de IP. Tambi&eacute;n las p&aacute;ginas visitadas, las b&uacute;squedas realizadas, las publicaciones, calificaciones y replicadas ingresadas, mensajes en los foros, entre otra informaci &oacute;n podr&aacute; ser almacenada y retenida.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">El uso que le damos a la informaci &oacute;n</span></strong></p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;requiere cierta informaci &oacute;n de car&aacute;cter personal, incluyendo direcci &oacute;n de e-mail. La recolecci &oacute;n de informaci &oacute;n nos permite ofrecer y mejorar a los usuarios servicios y funcionalidades que se adec&uacute;en a mejorar sus necesidades y personalizar nuestro servicio para que navegar por&nbsp;<strong><em>Worklife</em></strong>&nbsp;sea una experiencia agradable y c &oacute;moda. La informaci &oacute;n que recabamos tiene las siguientes finalidades.</p>\r\n<ul>\r\n<li>Ayudar al postulante y al usuario a entrar en contacto directo seg&uacute;n la modalidad del servicio ofrecido. En este caso&nbsp;<strong><em>Worklife</em></strong>&nbsp;suministrar&aacute; a los interesados sus datos personales (Nombres, tel&eacute;fonos, localidad y correo electr &oacute;nico), a trav&eacute;s de correo electr &oacute;nico o a trav&eacute;s del sitio. La informaci &oacute;n as&iacute; conocida por el usuario o postulante, solo podr&aacute; ser utilizada a efectos de concluir la operaci &oacute;n originada en&nbsp;<strong><em>Worklife</em></strong>&nbsp;y no deber&aacute; ser empleada por ninguno de ellos con fines publicitarios o promocionales u otras actividades no relacionadas con&nbsp;<strong><em>Worklife</em></strong>, salvo expresa autorizaci &oacute;n del usuario o postulante.</li>\r\n<li>Desarrollar estudios internos sobre los intereses, comportamientos y demograf&iacute;a de los usuarios para comprender mejor a las necesidades e intereses y ofrecer mejores servicios o proveerles informaci &oacute;n relacionada.</li>\r\n<li>Mejorar nuestras iniciativas comerciales y promocionales y analizar las p&aacute;ginas visitadas las b&uacute;squedas realizadas por los usuarios, para mejorar nuestra oferta de contenidos y art&iacute;culos, personalizar dichos contenidos, su presentaci &oacute;n y servicios.</li>\r\n<li>Enviar informaci &oacute;n o mensajes por e-mail sobre nuevos servicios, mostrar publicidad o promociones, banners, de inter&eacute;s para nuestros usuarios, noticias sobre&nbsp;<strong><em>Worklife</em></strong>. Si el usuario lo desea puede solicitar que se excluya del env&iacute;o de esta informaci &oacute;n envianos un e-mail a<strong>&nbsp;<span style=\"text-decoration: underline;\">soporte@worklife.com.ar</span></strong></li>\r\n<li>Enviar informaci &oacute;n o avisos por mensajes cortos de texto (SMS) al tel&eacute;fono celular suministrado por el usuario a&nbsp;<strong><em>Worklife</em></strong>. Los mensajes podr&aacute;n contener informaci &oacute;n del sitio, promociones, vencimientos de pagos, claves, u otras obligaciones adquiridas por el uso del servicio, entre otros.</li>\r\n</ul>\r\n<p>Si decidimos revelar o compartir informaci &oacute;n personal con terceros que no son proveedores de servicios o empresas afiliadas o relacionadas con&nbsp;<strong><em>Worklife</em></strong>, requerimos tu consentimiento:</p>\r\n<ul>\r\n<li>Entre los proveedores de servicios que recogen informaci &oacute;n directamente del usuario se encuentra Google Inc., una compa&ntilde;&iacute;a de Delaware cuya oficina principal est&aacute; en 1600 Amphitheatre Parkway, Mountain Vi8ew (California), CA 94043, Estados Unidos (\"Google\"). Mediante el uso de \"Cookies\", ver apartado sobre Cookies).</li>\r\n</ul>\r\n<p>Google obtiene cierta informaci &oacute;n sobre la actividad de los usuarios de&nbsp;<strong><em>Worklife</em></strong>&nbsp;y sus direcciones de IP, que es directamente trasmitida y archivada por Google en los servidores de Estados Unidos. Google usar&aacute; esta informaci &oacute;n por cuenta de&nbsp;<strong><em>Worklife</em></strong>&nbsp;con el prop &oacute;sito de analizar y confeccionar informes sobre la actividad de los usuarios en internet, con el fin de mejorar nuestros servicios prestados por el sitio. Google podr&aacute; trasmitir dicha informaci &oacute;n a terceros cuando as&iacute; lo requiera la normativa aplicable, o cuando dichos terceros procesen la informaci &oacute;n por cuenta de Google.</p>\r\n<p>El usuario consiente expresamente al tratamiento de su informaci &oacute;n por Google en la forma y para los fines aqu&iacute; indicados.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Geolocalizaci &oacute;n</span></strong></p>\r\n<p>La informaci &oacute;n suministrada en \"mi cuenta\" o en las publicaciones para esta herramienta, es de exclusiva responsabilidad del usuario, deslindando de cualquier responsabilidad a worklife, esta informaci &oacute;n es orientativa y se utilizar&aacute; para la correcta funcionabilidad de la herramienta en cuesti &oacute;n a fin de facilitar b&uacute;squedas m&aacute;s precisas entre usuarios.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Confidencialidad de la informaci &oacute;n</span></strong></p>\r\n<p>Una vez registrado en su sitio web,&nbsp;<strong><em>Worklife</em></strong>&nbsp;no vender&aacute;, alquilar&aacute; o compartir&aacute; la informaci &oacute;n personal excepto en las formas establecidas en estas pol&iacute;ticas. Sin perjuicio de ello, el usuario consiente en forma expresa que&nbsp;<strong><em>Worklife</em></strong>&nbsp;transfiera total o parcialmente la informaci &oacute;n personal a cualquiera de las sociedades contraladas, controlantes y/o vinculadas con&nbsp;<strong><em>Worklife</em></strong>, a cualquier t&iacute;tulo y en el momento, forma y condiciones que estime pertinente. Haremos todo lo que est&eacute; a nuestro alcance para proteger la privacidad de la informaci &oacute;n. Puede suceder que en virtud de &oacute;rdenes judiciales, o de regulaciones legales, nos veamos con pedidos a revelar informaci &oacute;n a las autoridades o terceras partes bajo ciertas circunstancias, o bien en casos de que terceras partes puedan interceptar o acceder a cierta informaci &oacute;n o transmisiones de datos en cuyo caso&nbsp;<strong><em>Worklife</em></strong>&nbsp;no responder&aacute; por la informaci &oacute;n que sea revelada.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Clave personal</span></strong></p>\r\n<p>Para acceder a los servicios reservados &uacute;nicamente a los usuarios debidamente registrados los usuarios dispondr&aacute;n de una clave personal. Con ella podr&aacute;n contactar, publicar, calificar, o realizar comentarios de los servicios contactados entre otras actividades. Esta clave debe mantenerla bajo absoluta confidencialidad, y, en ning&uacute;n caso, deber&aacute;n revelarla o compartirla con otras personas.</p>\r\n<p>El usuario ser&aacute; responsable de todos los actos que tengan lugar mediante el uso de su usuario y clave, lo que incluye hacerse cargo del pago de las tarifas que eventualmente se devenguen o por los perjuicios que puedan sufrir otros usuarios.</p>\r\n<p>Los usuarios pueden cambiar su clave en cualquier momento para mejorar su confidencialidad.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Cookies</span></strong></p>\r\n<p>El usuario y el visitante del sitio web de&nbsp;<strong><em>Worklife</em></strong>&nbsp;conocen y aceptan que&nbsp;<strong><em>Worklife</em></strong>&nbsp;podr&aacute; utilizar un sistema de seguimiento mediante la utilizaci &oacute;n de Cookies (las cookies). Las Cookies son peque&ntilde;os archivos que se instalan en el disco r&iacute;gido, con una duraci &oacute;n limitada en el tiempo que ayudan a personalizar los servicios. Tambi&eacute;n ofrecemos ciertas funcionalidades que solo est&aacute;n disponibles mediante el empleo de cookies, Las Cookies se utilizan con el fin de conocer los intereses, el comportamiento y la demograf&iacute;a de quienes visitan o son usuarios de nuestro sitio web y de esa forma, comprender mejor sus necesidades e intereses y darles un mejor servicio o proveerles informaci &oacute;n seleccionada. Tambi&eacute;n usaremos la informaci &oacute;n obtenida por intermedio de las cookies para analizar las paginas navegadas por el visitante o usuario, las b&uacute;squedas realizadas, mejorar nuestras iniciativas comerciales y promocionales, mostrar publicidad o promociones, banners de inter&eacute;s, noticias sobre&nbsp;<strong><em>Worklife</em></strong>, perfeccionar nuestra oferta de contenidos, personalizar dichos contenidos, presentaci &oacute;n y servicios; Tambi&eacute;n podremos utilizar cookies para promover y hacer cumplir las reglas y seguridad del sitio.<strong><em>Worklife</em></strong>&nbsp;podr&aacute; agregar cookies en los e-mails que env&iacute;e para medir la efectividad de las promociones.</p>\r\n<p>Utilizamos adicionalmente para que el usuario no tenga que introducir su clave tan frecuentemente durante una sesi &oacute;n de navegaci &oacute;n, tambi&eacute;n para contabilizar y corroborar las registraciones, la actividad del usuario. Siempre teniendo como objetivo de la instalaci &oacute;n de las cookies, en beneficio del usuario que las recibe y no ser&aacute; usado con otros fines ajenos a&nbsp;<strong><em>Worklife</em></strong>.</p>\r\n<p>Se establece que la instalaci &oacute;n, permanencia y existencia de las cookies en el computador del usuario depende de su exclusiva voluntad y puede ser eliminada de su computadora cuando el usuario as&iacute; lo desee.</p>\r\n<p>Se aclara expresamente que estas pol&iacute;ticas cubre la utilizaci &oacute;n de cookies por este sitio y no la utilizaci &oacute;n de cookies por partes de anunciantes. Nosotros no controlamos el uso de cookies por terceros.</p>\r\n<p><br /> <strong><span style=\"text-decoration: underline;\">Web Beacons</span></strong></p>\r\n<p>Una web beacons es una imagen electr &oacute;nica tambi&eacute;n llamada single-pixel (1x1) o pixel transparente, que es colocada en c &oacute;digo de una p&aacute;gina web, un web beacons tiene finalidades similares a las cookies. Adicionalmente un web beacons es utilizado para medir patrones de tr&aacute;fico de los usuarios de una p&aacute;gina a otra con el objeto de maximizar como fluye el tr&aacute;fico a trav&eacute;s de la web. El usuario y el visitante del sitio web aceptan que&nbsp;<strong><em>Worklife</em></strong>&nbsp;podr&aacute; utilizar un sistema de seguimiento mediante la utilizaci &oacute;n de web beacons.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Acceso, cancelaci &oacute;n y modificaci &oacute;n de informaci &oacute;n personal</span></strong></p>\r\n<p>Los usuarios registrados en&nbsp;<strong><em>Worklife</em></strong>&nbsp;tienen el derecho de acceder, cancelar y actualizar la informaci &oacute;n personal suministrada por estos al momento de la registraci &oacute;n en el sitio, todo ello de conformidad a lo dispuesto en la normativa vigente.</p>\r\n<p>Los usuarios son los &uacute;nicos responsables por la informaci &oacute;n suministrada, garantizan y responden, en cualquier caso, de la veracidad, exactitud, vigencia y autenticidad de la informaci &oacute;n personal facilitada, se comprometen tambi&eacute;n a que la informaci &oacute;n informada sea debidamente actualizada.</p>\r\n<p>En determinados casos, mantendremos en nuestros archivos informaci &oacute;n personal que nos hayan pedido que retiremos, y ello con finalidad de resolver disputas o reclamaciones, detectar problemas o incidencias y solucionarlos, y dar cumplimiento a lo dispuesto en los t&eacute;rminos y condiciones generales por un periodo de tiempo determinado por la ley. En cualquier caso, la informaci &oacute;n personal de un usuario no ser&aacute; inmediatamente retirada de nuestros archivos por motivos legales y t&eacute;cnicos, incluyendo sistemas de soportes de seguridad. Por tanto, no se debe esperar que toda informaci &oacute;n personal sea definitivamente borrada de nuestras bases de datos. Si deseas cancelar tu cuenta env&iacute;anos un e-mail a<strong>&nbsp;<span style=\"text-decoration: underline;\">soporte@worklife.com.ar</span>.</strong></p>\r\n<p><strong><em>Worklife</em></strong>, se reserva el derecho de modificar, suspender o finalizar cualquier publicaci &oacute;n de su p&aacute;gina web en cualquier momento como as&iacute; tambi&eacute;n&nbsp;<strong><em>Worklife</em></strong>&nbsp;podr&aacute; modificar en cualquier momento sin previo aviso a los usuarios los t&eacute;rminos y condiciones y en las pol&iacute;ticas de privacidad y confidencialidad y pol&iacute;tica de servicios prohibidos. Si decidimos introducir alg&uacute;n cambio notificaremos a todos los usuarios publicando una versi &oacute;n actualizada de las pol&iacute;ticas en esta secci &oacute;n.</p>\r\n<p>Si hacemos cambios materiales en la forma que tu informaci &oacute;n personal es administrada te notificaremos por e-mail para que puedas tomar una decisi &oacute;n respecto si aceptas o no que tu informaci &oacute;n personal sea utilizada de esa forma. Si no aceptas esos t&eacute;rminos, en ese caso quedar&aacute; disuelto el v&iacute;nculo contractual y tu informaci &oacute;n personal no ser&aacute; usada de otra forma que la que fue informada al momento de recabarse.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">El uso de la informaci &oacute;n por otros Usuarios</span></strong></p>\r\n<p>Para facilitar la interacci &oacute;n entre todos los miembros de la comunidad de&nbsp;<strong><em>WORKLIFE</em></strong>, nuestro servicio permite un acceso limitado a ciertos datos de contacto del resto de usuarios, tales como Nombre de usuario, Tel&eacute;fonos, Ciudad, direcci &oacute;n f&iacute;sica y de correo electr &oacute;nico, entre otros.</p>\r\n<p>Los usuarios s &oacute;lo podr&aacute;n utilizar la Informaci &oacute;n Personal de otros usuarios obtenida en el sitio para: (1) comunicaciones relacionadas con&nbsp;<strong><em>WORKLIFE</em></strong>&nbsp;que no constituyan comunicaciones comerciales no solicitadas, (2) utilizar servicios ofrecidos en&nbsp;<strong><em>WORKLIFE</em></strong>.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Seguridad. Almacenamiento de la informaci &oacute;n</span></strong></p>\r\n<p><strong><em>WORKLIFE</em></strong>&nbsp;est&aacute; obligado a cumplir con toda la normativa aplicable en materia de medidas de seguridad aplicables a la Informaci &oacute;n Personal. Adicionalmente,&nbsp;<strong><em>WORKLIFE</em></strong>usa los est&aacute;ndares de la industria entre materia de protecci &oacute;n de la confidencialidad de su Informaci &oacute;n Personal, incluyendo, en otras medidas, cortafuegos (\"firewalls\").<strong><em>Worklife</em></strong>&nbsp;considera a los datos de sus usuarios como un activo que debe ser protegido de cualquier p&eacute;rdida o acceso no autorizado. Empleamos diversas t&eacute;cnicas de seguridad para proteger tales datos de accesos no autorizados por usuarios de dentro o fuera de nuestra compa&ntilde;&iacute;a. Sin embargo, es necesario tener muy en cuenta que la seguridad perfecta no existe en Internet.</p>\r\n<p>El usuario de&nbsp;<strong><em>WORKLIFE</em></strong>&nbsp;conoce y acepta expresamente que&nbsp;<strong><em>WORKLIFE</em></strong>, a su exclusivo criterio, recabe, almacene y monitoree el intercambio de mensajes y correos electr &oacute;nicos entre sus usuarios, efectuado dentro de la comunidad de&nbsp;<strong><em>WORKLIFE</em></strong>, con el objetivo de contribuir a la seguridad de las relaciones y comunicaciones en la comunidad.</p>\r\n<p>Por ello,&nbsp;<strong><em>WORKLIFE</em></strong>&nbsp;no se hace responsable por interceptaciones ilegales o violaci &oacute;n de sus sistemas o bases de datos por parte de personas no autorizadas.&nbsp;<strong><em>WORKLIFE</em></strong>, tampoco se hace responsable por la indebida utilizaci &oacute;n de la informaci &oacute;n obtenida por esos medios.</p>\r\n<p>Todos los datos personales de los usuarios ser&aacute;n almacenados en un fichero automatizado de datos personales. El fichero de Datos Personales de los usuarios de<strong><em>WORKLIFE</em></strong>&nbsp;reside en EE.UU.&nbsp;<strong>El usuario al registrarse en&nbsp;<em>WORKLIFE</em>&nbsp;confirma que est&aacute; informado de la residencia de este fichero y autoriza esta transferencia internacional de sus datos.</strong></p>\r\n<p>&nbsp;</p>', '2017-08-15', 0, '', '', '');
INSERT INTO `ic_contenido` (`pg_id`, `l_lang`, `pg_titulo`, `pg_conten`, `pg_creacion`, `pg_imprimir`, `pg_tag_titulo`, `pg_tag_desc`, `pg_tag_key`) VALUES
(8, '_en', 'Terminos y Condiciones', '<p>Este contrato describe los t&eacute;rminos y condiciones generales (los T&eacute;rminos y Condiciones Generales) aplicables al uso de los servicios ofrecidos por&nbsp;<strong>WORKLIFE</strong>(los Servicios) dentro del sitio&nbsp;<strong>www.worklife.com.ar</strong>,(worklife o el sitio) y/o las aplicaciones m&oacute;viles que&nbsp;<strong>WORKLIFE&nbsp;</strong>haya puesto a disposici&oacute;n.</p>\r\n<p>LEA ESTE ACUERDO DETENIDAMENTE ANTES DE UTILIZAR LOS SERVICIOS. AL UTILIZAR EL SITIO WEB&nbsp;<strong><em>WWW.WORKLIFE.COM.AR</em></strong>&nbsp;(EN ADELANTE, EL SITIO), USTED ACEPTA LOS T&Eacute;RMINOS Y CONDICIONES, POLITICAS DE PRIVACIDAD Y POLITICA DE SERVICIOS PROHIBIDOS DE ESTE ACUERDO. SI USTED NO ACEPTA LOS T&Eacute;RMINOS Y CONDICIONES, POLITICAS DE PRIVACIDAD Y POLITICA DE SERVICIOS PROHIBIDOS DE ESTE ACUERDO, NO TENDR&Aacute; DERECHO A UTILIZAR EL SITIO NI LOS SERVICIOS. LA ACEPTACI&Oacute;N DE&nbsp;<strong><em>WORKLIFE</em></strong>&nbsp;EST&Aacute; EXPRESAMENTE SUPEDITADA A QUE USTED MANIFIESTE LA ACEPTACI&Oacute;N DE TODOS LOS T&Eacute;RMINOS Y CONDICIONES DE ESTE ACUERDO, INCLU&Iacute;DA LAS POL&Iacute;TICAS DE PRIVACIDAD Y POLITICA DE SERVICIOS PROHIBIDOS DE WORKLIFE CON EXCLUSI&Oacute;N DE TODOS LOS DEM&Aacute;S T&Eacute;RMINOS Y CONDICIONES.</p>\r\n<p>Cualquier persona (en adelante Usuario o en plural Usuarios) que desee acceder y/o usar el sitio o los Servicios podr&aacute; hacerlo sujet&aacute;ndose a los T&eacute;rminos y Condiciones Generales respectivos, junto con todas las dem&aacute;s pol&iacute;ticas y principios que rigen en&nbsp;<strong><em>WORKLIFE</em></strong>&nbsp;y que son incorporados al presente por referencia.</p>\r\n<p>CUALQUIER PERSONA QUE NO ACEPTE ESTOS T&Eacute;RMINOS Y CONDICIONES GENERALES, LAS POLITICAS DE PRIVACIDAD Y LA POLITICA DE SERVICIOS PROHIBIDOS, LOS CUALES TIENEN UN CAR&Aacute;CTER OBLIGATORIO Y VINCULANTE, DEBER&Aacute;; ABSTENERSE DE UTILIZAR EL SITIO Y/O LOS SERVICIOS.</p>\r\n<p>El Usuario debe leer, entender y aceptar todas las condiciones establecidas en los T&eacute;rminos y Condiciones Generales, en las Pol&iacute;ticas de Privacidad y en la Pol&iacute;tica de los servicios prohibidos as&iacute; como en los dem&aacute;s documentos incorporados a los mismos por referencia, previo a su registraci&oacute;n como Usuario de&nbsp;<strong><em>WORKLIFE</em></strong>.</p>\r\n<p align=\"center\"><strong><em>El uso de este sitio web implica la aceptaci&oacute;n de T&eacute;rminos y Condiciones, de las Pol&iacute;ticas de Privacidad y de las Pol&iacute;tica de los servicios prohibidos de WORKLIFE.com.ar</em></strong></p>\r\n<p><strong><span style=\"text-decoration: underline;\">T&eacute;rminos y condiciones del uso del sitio:</span></strong></p>\r\n<p><strong><span style=\"text-decoration: underline;\">I - Usuarios</span></strong></p>\r\n<p>Veracidad y actualizaci&oacute;n de los datos</p>\r\n<p>El usuario registrado o el suscriptor de los boletines informativos es el &uacute;nico responsable de la veracidad y correcci&oacute;n de los datos incluidos exoner&aacute;ndose&nbsp;<strong><em>Worklife</em></strong>&nbsp;de cualquier responsabilidad al respecto.</p>\r\n<p>El Usuario ser&aacute; responsable por todas las operaciones efectuadas en su Cuenta, pues el acceso a la misma est&aacute; restringido al ingreso y uso de su Clave de Seguridad, de conocimiento exclusivo del Usuario. El Usuario se compromete a notificar a<strong><em>&nbsp;WORKLIFE&nbsp;</em></strong>en forma inmediata y por medio id&oacute;neo y fehaciente, cualquier uso no autorizado de su Cuenta, as&iacute; como el ingreso por terceros no autorizados a la misma. Se aclara que est&aacute; prohibida la venta, cesi&oacute;n o transferencia de la Cuenta (incluyendo la reputaci&oacute;n y calificaciones) bajo ning&uacute;n t&iacute;tulo.</p>\r\n<p><strong><em>WORKLIFE&nbsp;</em></strong>se reserva el derecho de rechazar cualquier solicitud de registraci&oacute;n o de cancelar una registraci&oacute;n previamente aceptada, sin que est&aacute; obligado a comunicar o exponer las razones de su decisi&oacute;n y sin que ello genere alg&uacute;n derecho a indemnizaci&oacute;n o resarcimiento.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">II - Correcta utilizaci&oacute;n de los sites</span></strong></p>\r\n<p>Todo aquel usuario que acceda al sitio de&nbsp;<strong><em>Worklife</em></strong>&nbsp;se compromete a la correcta utilizaci&oacute;n de cuantos servicios se encuentran en el mismo, a tenor de lo establecido en la legislaci&oacute;n vigente que le fuera aplicable y a lo contenido en las condiciones generales y en su caso, en las condiciones particulares publicadas en este sitio en cada momento para cada producto o servicio, absteni&eacute;ndose de realizar cualquier acto que pudiera ir en contra de los intereses de terceros y de la estructura y funcionamiento del sitio de<strong><em>Worklife</em></strong>.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">III - Opiniones</span></strong></p>\r\n<p>En nuestro sitio se incorpora la posibilidad de opinar sobre el servicio publicitado.&nbsp;<strong><em>Worklife</em></strong>&nbsp;no se hace responsable de las opiniones o comentarios realizadas por el usuario oblig&oacute;ndose este &uacute;ltimo a no publicar comentarios o acciones: (i) difamatorios, inexactos, falsos, abusivos, obscenos, irreverentes, ofensivos, insultantes, tacita o expresamente sexuales, amenazantes, acosadores, racistas, sexistas, discriminatorios por cualquier motivo, que atenten contra la moral, orden p&uacute;blico, los derechos fundamentales, las libretas p&uacute;blicas, la normativa vigente, y/o infractores de derechos de terceros. (ii)Trasmisores de correo basura, \"SPAM\", Mensajes con fines comerciales, o mailings masivos no solicitados, falsos, enga&ntilde;osos o promuevan actividades ilegales o conducta grosera, amenazante, obscena, difamatoria o injuriosa. (iii) Que suministren informaci&oacute;n pr&aacute;ctica sobre actividades ilegales. (iv) Que conlleven cualquier actividad publicitaria o comercial, incluso aunque no haya contraprestaci&oacute;n monetaria. (v) Que contengan datos de car&aacute;cter personal sobre terceras personas que requieran el consentimiento del titular de los derechos. El usuario responder&aacute; frente a&nbsp;<strong><em>Worlklife</em></strong>&nbsp;o frente a cualquier tercero, de cualesquiera da&ntilde;os y perjuicios que pudieran causarse como consecuencia del incumplimiento de dichas obligaciones. El sitio permite la emisi&oacute;n y publicaci&oacute;n de opiniones, positivas o negativas.&nbsp;<strong><em>Worklife</em></strong>&nbsp;no interviene las opciones de los usuarios. No obstante, no publicar&aacute; o eliminar&aacute; las opiniones que no cumplan con las condiciones anteriores, no haciendose responsable ni garantizando la veracidad y exactitud de las opiniones que puedan exponerse por los usuarios en su web.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">IV - Responsabilidades</span></strong></p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;no se responsabiliza de las consecuencias derivadas del incumplimiento por parte del usuario de las condiciones generales de uso, o en su caso, de las condiciones particulares reguladoras de algunos servicios, recogidas dentro del sitio de&nbsp;<strong><em>Worklife</em></strong>.</p>\r\n<p>Todos los servicios a los que se accede a trav&eacute;s de nuestro sitio, incluyendo cualquier acci&oacute;n o la realizaci&oacute;n de cualquier obligaci&oacute;n y/o derecho entre los usuarios del sitio y los anunciantes, se consideran realizados entre estas dos partes, quedando&nbsp;<strong><em>Worklife</em></strong>&nbsp;exento de cualquier tipo de responsabilidad</p>\r\n<p>Para el caso de cualquier responsabilidad exigible a&nbsp;<strong><em>Worklife</em></strong>, &eacute;sta tan solo responder&aacute;; por los da&ntilde;os y perjuicios efectiva y directamente causados por ella, sin incluir en ning&uacute;n caso compensaci&oacute;n por lucro cesante.</p>\r\n<p><strong><em>Worklife</em></strong>, no es responsable por la condici&oacute;n tributaria y/o condici&oacute;n migratoria de los usuarios que utilizan el sitio, siendo exclusiva responsabilidad del usuario.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">V - T&eacute;cnicas</span></strong></p>\r\n<p>Nuestro sitio puede ser desconectados o alterados sin previo aviso, no gener&aacute;ndose responsabilidad alguna para&nbsp;<strong><em>Worklife</em></strong>&nbsp;con el usuario o con terceras partes por tal motivo.</p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;no responde del mal funcionamiento del sistema cuando este se deba a condiciones t&eacute;cnicas o por causas de terceros.</p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;declina cualquier responsabilidad respecto a los servicios y contenidos que se hallen tanto fuera como dentro del sitio, ni ser&aacute; responsable por los da&ntilde;os y perjuicios de toda naturaleza derivados de la falta de disponibilidad o de continuidad del funcionamiento de los servicios ofertados en nuestros sitio.</p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;no controla todo lo contenido dentro del sitio, no responsabiliz&aacute;ndose as&iacute; de cuantos da&ntilde;os y perjuicios pudieran derivarse de la existencia de cualquier tipo de virus u otro elemento que pueda producir alteraciones en el sistema inform&aacute;tico, ni tampoco de los da&ntilde;os y perjuicios que los mismos puedan causar al hardware o software de los usuarios.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">VI - Contenidos</span></strong></p>\r\n<p>Los dispositivos de enlace (links, banners, botones...) que aparecen en nuestro sitio, tienen por objeto poner en conocimiento del usuario la existencia de otras fuentes de informaci&oacute;n sobre la materia en internet, as&iacute; como facilitar a los usuarios la b&uacute;squeda y acceso a la informaci&oacute;n disponible en internet; dichos dispositivos no suponen una sugerencia, invitaci&oacute;n o recomendaci&oacute;n para la visita de los lugares de destino, y por ello,&nbsp;<strong><em>Worklife</em></strong>&nbsp;no ser&aacute; responsable del resultado a trav&eacute;s de dichos enlaces.</p>\r\n<p>En ning&uacute;n caso, ser&aacute; responsable&nbsp;<strong><em>Worklife&nbsp;</em></strong>por la informaci&oacute;n que faciliten enlaces a otros contenidos o, incluyan en los suyos directorios o instrumentos de b&uacute;squeda de contenido, siempre que&nbsp;<strong><em>Worklife</em></strong>&nbsp;no tenga conocimiento efectivo que la informaci&oacute;n a la que se remiten es il&iacute;cita o que lesiona bienes o derechos de un tercero susceptiblemente de indemnizaci&oacute;n y si lo tuviere ese conocimiento, actue con diligencia para suprimir o inutilizar el enlace correspondiente.</p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;no controla ni ofrece ninguna clase de garant&iacute;a sobre la identidad de los usuarios, ni sobre la veracidad, vigencia y autenticidad de los datos que los usuarios proporcionan sobre s&iacute; mismos o sobre otros usuarios; no responsabiliz&aacute;ndose as&iacute; por los da&ntilde;os y perjuicios de toda naturaleza que puedan deberse a la incorrecta identidad de los usuarios y a la falta de veracidad, vigencia y autenticidad de la informaci&oacute;n que los usuarios proporcionen acerca de si mismos o hacen accesibles para otros usuarios.</p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;se reserva el derecho de iniciar cualquier acci&oacute;n o adoptar cualquier remedio que sea necesario a fin de garantizar el cumplimiento de estos t&eacute;rminos y condiciones, entre los cuales se incluye, sin limitaci&oacute;n, filtrar el acceso grafico y/o, suspender o cancelar cuentas de acceso a usuarios que sean detectados en un acto de abuso de sistema o que se rehusen a brindar informaci&oacute;n del abuso cometido.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">VII - Modificaciones del Acuerdo</span></strong></p>\r\n<p><strong><em>Worklife</em></strong>&nbsp;podr&aacute; modificar los T&eacute;rminos y Condiciones Generales, Pol&iacute;ticas de Privacidad y Pol&iacute;tica de servicios prohibidos en cualquier momento haciendo p&uacute;blicos en el Sitio los t&eacute;rminos modificados. Todos los t&eacute;rminos modificados entrar&aacute;n en vigor a los 10 (diez) d&iacute;as de su publicaci&oacute;n. Dentro de los 5 (cinco) d&iacute;as siguientes a la publicaci&oacute;n de las modificaciones introducidas, el Usuario deber&aacute; comunicar por e-mail si no acepta las mismas; en ese caso quedar&aacute; disuelto el v&iacute;nculo contractual y ser&aacute; inhabilitado como Usuario siempre que no tenga deudas pendientes. Vencido este plazo, se considerar&aacute; que el Usuario acepta los nuevos t&eacute;rminos y el contrato continuar&aacute; vinculando a ambas partes.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">VIII - Listado de Bienes</span></strong></p>\r\n<p><strong>A - Publicaci&oacute;n de servicios</strong>. El Usuario deber&aacute; ofrecer los servicios en las categor&iacute;as y subcategor&iacute;as apropiadas. Las publicaciones podr&aacute;n incluir textos descriptivos, gr&aacute;ficos, fotograf&iacute;as y otros contenidos y condiciones pertinentes para la promoci&oacute;n del servicio, siempre que no violen ninguna disposici&oacute;n de este acuerdo o dem&aacute;s pol&iacute;ticas de<strong><em>Worklife</em></strong>. El servicio ofrecido por el Usuario debe ser exactamente descripto en cuanto a sus condiciones y caracter&iacute;sticas relevantes.&nbsp;<strong><em>Worklife</em></strong>&nbsp;podr&aacute; remover cualquier publicaci&oacute;n cuya publicaci&oacute;n no sea expresada de esta forma para evitar confusiones o malos entendidos en cuanto al servicio. Se deja expresamente establecido que ninguna descripci&oacute;n podr&aacute; contener datos personales o de contacto, tales como, y sin limitarse a, n&uacute;meros telef&oacute;nicos, direcci&oacute;n de e-mail, direcci&oacute;n postal, direcciones de p&aacute;ginas de Internet que contengan datos como los mencionados anteriormente, En caso que se infrinja cualquiera de las disposiciones establecidas en esta clausula,<strong><em>Worklife</em></strong>&nbsp;podr&aacute; editar el espacio, solicitar al Usuario que lo edite, o dar de baja la publicaci&oacute;n que est&eacute; en infracci&oacute;n.<br /> <strong>B-&nbsp;Inclusi&oacute;n de im&aacute;genes y fotograf&iacute;as</strong></p>\r\n<p>El usuario puede incluir im&aacute;genes y fotograf&iacute;as del servicio ofrecido siempre que las mismas se correspondan con el servicio. Si&nbsp;<strong><em>Worklife</em></strong>&nbsp;entiende que la imagen no corresponde con el servicio ofrecido podr&aacute; eliminar la publicaci&oacute;n o solicitar al usuario que modifique la imagen.</p>\r\n<p><strong>C- Servcios Prohibidos</strong>.</p>\r\n<p>S&oacute;lo podr&aacute;n ser ingresados en las listas de servicios promocionados, aquellos que no se encuentre t&aacute;cita o expresamente prohibida en los T&eacute;rminos y Condiciones Generales y dem&aacute;s pol&iacute;ticas de&nbsp;<strong><em>Worklife</em></strong>&nbsp;o por la ley vigente. Para obtener mayor informaci&oacute;n sobre servicios prohibidos, se pueden consultar nuestras<strong>Pol&iacute;ticas de Servicios Prohibidos</strong>&nbsp;de&nbsp;<strong><em>Worklife</em></strong>.&nbsp;<strong><em>Worklife</em></strong>&nbsp;puede dar de baja una publicaci&oacute;n si considera que esa publicaci&oacute;n puede ocasionar alg&uacute;n perjuicio a otro usuario o simplemente la considera que no es apropiada para el sitio.</p>\r\n<p><br /> <strong><span style=\"text-decoration: underline;\">IX - Prohibiciones</span></strong></p>\r\n<p>Los Usuarios no podr&aacute;n:</p>\r\n<p>1 - Aceptar datos personales proporcionados por otros usuarios a trav&eacute;s de la secci&oacute;n de Preguntas y Respuestas y/o algun otro medio (incluyendo pero sin limitar Twitter, Facebook y/o cualquier otra red social).</p>\r\n<p>2 - Publicar servicios prohibidos por los T&eacute;rminos y Condiciones Generales, dem&aacute;s pol&iacute;ticas de&nbsp;<strong><em>WORKLIFE</em></strong>&nbsp;o leyes vigentes</p>\r\n<p>3 - Insultar o agredir a otros Usuarios</p>\r\n<p>4 - Utilizar su reputaci&oacute;n, calificaciones, comentarios o r&eacute;plicas recibidas en el sitio de&nbsp;<strong><em>worklife</em></strong>&nbsp;en cualquier &aacute;mbito fuera de&nbsp;<strong><em>Worklife</em></strong>.</p>\r\n<p>Este tipo de actividades ser&aacute; investigado por&nbsp;<strong><em>Worklife</em></strong>&nbsp;y el infractor podr&aacute; ser sancionado con la suspensi&oacute;n o cancelaci&oacute;n del servicio e incluso de su inscripci&oacute;n como Usuario de&nbsp;<strong><em>Worklife</em></strong>&nbsp;y/o de cualquier otra forma que estime pertinente, sin perjuicio de las acciones legales a que pueda dar lugar por la configuraci&oacute;n de delitos o contravenciones o los perjuicios civiles que pueda causar a los Usuarios oferentes.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">X - Violaciones del Sistema o Bases de Datos</span></strong></p>\r\n<p>No est&aacute; permitida ninguna acci&oacute;n o uso de dispositivo, software, u otro medio tendiente a interferir tanto en las actividades y operatoria de&nbsp;<strong><em>Worklife</em></strong>&nbsp;como en las publicaciones, descripciones, cuentas o bases de datos de&nbsp;<strong><em>Worklife</em></strong>. Cualquier intromisi&oacute;n, tentativa o actividad violatoria o contraria a las leyes sobre derecho de propiedad intelectual y/o a las prohibiciones estipuladas en este contrato haran pasible a su responsable de las acciones legales pertinentes, y a las sanciones previstas por este acuerdo, as&iacute; como lo har&aacute; responsable de indemnizar los da&ntilde;os ocasionados</p>\r\n<p><br /> <strong><span style=\"text-decoration: underline;\">XI - Alcance de los servicios de Worklife</span></strong></p>\r\n<p>Este acuerdo no crea ning&uacute;n contrato de sociedad, de mandato, de franquicia, o relaci&oacute;n laboral entre&nbsp;<strong><em>Worklife</em></strong>&nbsp;el Usuario. El Usuario reconoce y acepta que&nbsp;<strong><em>Worklife</em></strong>&nbsp;no es parte en ninguna operaci&oacute;n, ni tiene control alguno sobre la calidad, seguridad o legalidad de los servicios anunciados, la veracidad o exactitud de los anuncios, la capacidad de los Usuarios para brindar el servicio.&nbsp;<strong><em>Worklife&nbsp;</em></strong>no garantiza la veracidad de la publicidad de terceros que aparezca en el sitio y no ser&aacute; responsable por la correspondencia o contratos que el Usuario celebre con dichos terceros o con otros Usuarios.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">XII - Sistema de reputaci&oacute;n</span></strong></p>\r\n<p>Debido a que la verificaci&oacute;n de la identidad de los Usuarios en Internet es dif&iacute;cil,&nbsp;<strong><em>Worklife</em></strong>&nbsp;no puede confirmar ni confirma la identidad pretendida de cada Usuario.&nbsp;<strong><em>Worklife</em></strong>cuenta con un sistema de reputaci&oacute;n de Usuarios que es actualizado peri&oacute;dicamente en base a datos vinculados con su actividad en el sitio, a los comentarios y puntuaciones ingresados por los Usuarios seg&uacute;n las operaciones que hayan realizado. Todo usuario que haya hecho click en el bot&oacute;n \"contactar\" deber&aacute; puntuar al usuario que brinda as&iacute; como tambi&eacute;n podr&aacute;n ingresar un comentario si as&iacute; lo desea.<br /> En virtud que las calificaciones, comentarios y r&eacute;plicas son realizados por los Usuarios, &eacute;stos seran incluidos bajo exclusiva responsabilidad de los Usuarios que los emitan.<strong><em>Worklife</em></strong>&nbsp;no tiene obligaci&oacute;n de verificar la veracidad o exactitud de los mismos y NO se responsabiliza por los dichos all&iacute; vertidos por cualquier Usuario, o por cualquier otro comentario expresado dentro del sitio o a trav&eacute;s de cualquier otro medio incluido el correo electr&oacute;nico.&nbsp;<strong><em>Worklife</em></strong>&nbsp;se reserva el derecho de eliminar aquellos comentarios que sean considerados inadecuados u ofensivos.<strong><em>Worklife</em></strong>&nbsp;mantiene el derecho de excluir a aquellos Usuarios que sean objeto de comentarios negativos provenientes de fuentes distintas.</p>\r\n<p><br /> <strong><span style=\"text-decoration: underline;\">XIII - Propiedad intelectual. Enlaces</span></strong></p>\r\n<p>Los contenidos de las pantallas relativas a los servicios de&nbsp;<strong><em>Worklife</em></strong>&nbsp;como as&iacute; tambi&eacute;n los programas, bases de datos, redes, archivos que permiten al Usuario acceder y usar su Cuenta, son de propiedad de&nbsp;<strong><em>Worklife</em></strong>&nbsp;y est&aacute;n protegidas por las leyes y los tratados internacionales de derecho de autor, marcas, patentes, modelos y dise&ntilde;os industriales. El uso indebido y la reproducci&oacute;n total o parcial de dichos contenidos quedan prohibidos, salvo autorizaci&oacute;n expresa y por escrito de&nbsp;<strong><em>Worklife</em>.</strong></p>\r\n<p>El Sitio puede contener enlaces a otros sitios web por&nbsp;<strong><em>Worklife</em></strong>. En virtud que&nbsp;<strong><em>Worklife</em></strong>&nbsp;no tiene control sobre tales sitios, NO ser&aacute; responsable por los contenidos, materiales, acciones y/o servicios prestados por los mismos, ni por da&ntilde;os o p&eacute;rdidas ocasionadas por la utilizaci&oacute;n de los mismos, sean causadas directa o indirectamente. La presencia de enlaces a otros sitios web no implica una sociedad, relaci&oacute;n, aprobaci&oacute;n, respaldo de&nbsp;<strong><em>Worklife</em></strong>&nbsp;a dichos sitios y sus contenidos.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">XIV- Indemnizaci&oacute;n</span></strong></p>\r\n<p>El Usuario acepta indemnizar y eximir de responsabilidad a&nbsp;<strong><em>Worklife</em></strong>&nbsp;(incluyendo pero no limitando a sus sociedades relacionadas, sus respectivos directores, gerentes, funcionarios, representantes, agentes y empleados) por cualquier reclamo o demanda (incluidos los honorarios razonables de abogados) formulados por cualquier Usuario y/o tercero por cualquier infracci&oacute;n a los T&eacute;rminos y Condiciones de Uso y dem&aacute;s&nbsp;<a href=\"wl/web/footerAnexoTermCondiciones.xhtml\">Anexos</a>&nbsp;y Pol&iacute;ticas que se entienden incorporadas al presente, y/o cualquier ley y/o derechos de terceros.</p>\r\n<p>A tal fin, el Usuario faculta a&nbsp;<strong><em>Worklife</em></strong>&nbsp;a: i) intervenir y representarlo en dichos reclamos o demandas, pudiendo arribar a acuerdos sin limitaci&oacute;n, en su nombre y representaci&oacute;n;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">XV - Jurisdicci&oacute;n y Ley Aplicable</span></strong></p>\r\n<p>Este acuerdo estar&aacute; regido en todos sus puntos por las leyes vigentes en la Rep&uacute;blica Argentina.</p>\r\n<p>Cualquier controversia derivada del presente acuerdo, su existencia, validez, interpretaci&oacute;n, alcance o cumplimiento, ser&aacute; sometida al arbitraje del Centro Empresarial de Mediaci&oacute;n y Arbitraje, de acuerdo con la reglamentaci&oacute;n vigente de dicho tribunal. La sede de dicho arbitraje ser&aacute; la Ciudad Aut&oacute;noma de Buenos Aires y los procedimientos se llevar&aacute;n a cabo en idioma castellano.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Anexo de t&eacute;rminos y condiciones</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Politica de servicios prohibidos</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>En esta pol&iacute;tica los usuarios podr&aacute;n encontrar el listado de servicios que worklife no permite que sean publicados en su sitio sin excepci&oacute;n.</p>\r\n<p>Si alg&uacute;n usuario realiza una publicaci&oacute;n conteniendo alg&uacute;n servicio en los que se encuentran contemplados en el listado de m&aacute;s abajo, Worklife podr&aacute; suprimir esa publicaci&oacute;n y advertir al usuario sobre las pol&iacute;ticas de servicios prohibidos.</p>\r\n<p>Si un mismo usuario intenta publicar 3 veces un servicio prohibido Worklife proceder&aacute; a suspender a ese usuario.</p>\r\n<p>Listado de servicios prohibidos por Worklife:</p>\r\n<ul>\r\n<li>Productos o servicios financieros como:\r\n<ul>\r\n<li>Pr&eacute;stamos o cr&eacute;ditos financieros.</li>\r\n<li>Cuentas bancarias y servicios de dep&oacute;sitos bancarios.</li>\r\n<li>Tarjetas de cr&eacute;dito o d&eacute;bito est&eacute;n o no en vigencia y servicios de obtenci&oacute;n de las mismas.</li>\r\n<li>Cr&eacute;dito para sitios de apuesta online o de pago electr&oacute;nico.</li>\r\n<li>Servicios, programas o mecanismos destinados a eliminar el historial crediticio de una persona f&iacute;sica o jur&iacute;dica.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>&nbsp;</strong></p>\r\n<ul>\r\n<li>Solicitudes u ofertas de art&iacute;culos con tem&aacute;ticas sexuales prohibidos por la ley, como: prostituci&oacute;n, pedofilia, zoofilia, necrofilia, incesto real.</li>\r\n<li>Acompa&ntilde;antes, strippers, taxi boy, citas y encuentros o cualquier publicaci&oacute;n que incluya la posible realizaci&oacute;n encubierta de un servicio sexual.</li>\r\n<li>Servicios de exhibici&oacute;n por webcam.</li>\r\n<li>&nbsp;Links a e-shops</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">XVI - Domicilio</span></strong></p>\r\n<p>Se fija como domicilio de&nbsp;<strong><em>Worklife</em></strong>&nbsp;en la calle Laprida 3177 Florida Buenos Aires, Rep&uacute;blica Argentina.</p>\r\n<p>Si tienes alguna duda sobre los T&eacute;rminos y Condiciones Generales o dem&aacute;s pol&iacute;ticas y principios que rigen en&nbsp;<strong><em>Worklife</em></strong>&nbsp;escribinos a&nbsp;<strong><span style=\"text-decoration: underline;\">soporte@worklife.com.ar</span></strong>.</p>\r\n<p>&nbsp;</p>', '2017-08-15', 0, '', '', '');
