(113, 'Servicio Técnico de PC a Domicilio  ', '', 'IC Informatica es una empresa de servicios informáticos enfocada a cubrir todas aquellas necesidades domesticas y empresariales, tanto en hardware como software.\r\nSomos un servicio desarrollado especialmente para atender la necesidad de actualizar, restaurar y revisar el equipamiento informático de nuestros clientes.\r\nTodo eso con una gran facilidad: su equipamiento puede ser retirado y entregado directamente en su domicilio.\r\nTrabajo apasionado, trato personal y ameno, una búsqueda incesante en solucionar todas las necesidades informáticas de nuestros clientes y un enfoque en la mejora permanente de todo lo que hacemos y cómo lo hacemos, es nuestro perfil como empresa.\r\nBuscamos y establecemos relaciones de largo plazo tanto con clientes como con proveedores, que devienen en fuertes lazos de confianza y trabajo.\r\n\r\nPara su comodidad brindamos un servicio completamente a domicilio:\r\n\r\n- Mantenimiento preventivo y correctivo\r\n- Armado de PC a medida de cada cliente \r\n- Actualización de equipos, instalación y configuración de software y hardware\r\n- Desinfección y eliminación de virus  \r\n- Recuperación de discos dañados \r\n- Backup de la información y todo lo que necesites de tu PC\r\n- Armado y configuración de Redes Cableadas e inalambricas   \r\n- Venta de equipos y componentes a bajo costo\r\n- Instalación y configuracion de camaras IP - DVR\r\n- Configuración de Routers \r\n- Reparación de Notebook y Netbook a nivel Electrónico\r\n- Servicio Técnico Impresoras EPSON\r\n- Actualización GPS Garmin\r\n- Reparación Monitores \r\n- Desbloqueo Definitivo Netbook Conectar Igualdad\r\n- Trabajos con Garantía\r\n', '15 nº 236', 'la plata ', 'BUENOS AIRES', '1900', '221-5930111', 'https://icinformatica.wixsite.com/icinformatica', '', 'ic.hardware@live.com.ar', '', 'images/directorio/1269748742Logo.jpg', '-34.9119158', '-57.97175720000001', 0, 554, '1', '', 'images/galeria/1131727112Servicio Tecnico 