(155, 'Modelado 3D & Render para Arquitectura - SKM Render', '', 'Somos una empresa que se especializa en servicios de Modelado 3D, Renders y Video de alta calidad para Arquitectura y Diseño. Producimos soluciones para satisfacer las necesidades de nuestros clientes con las últimas tecnologías. Nuestro trabajo va orientado hacia constructoras, arquitectos, diseñadores, decoradores, inmobiliarias y los grupos de inversión que busquen calidad y rapidez.', 'Marcos Paz 4670', 'Buenos Aires', 'CIUDAD AUTONOMA DE BUENOS AIRES', '1419', '1166164671', 'http://www.skmrender.com.ar/', 'Nuestra modalidad de trabajo se compone de 3 etapas.\r\n\r\n1ª Etapa | Una vez cerrado el proyecto se crea un modelado básico de la estructura sin materiales ni colores para definir de manera precisa su morfología y se entrega una primera instancia de preliminares al cliente.\r\n\r\n2ª Etapa | Terminada esta etapa, se le agregan los materiales, colores, muebles y algunos detalles del entorno, entregando así la segunda instancia de preliminares para corregir, sacar o añadir lo anterior mencionado.\r\n\r\n3ª Etapa | Concluido ya todo lo demás, procedemos a elaborar los renders finales, junto con la post producción', 'info@skmrender.com.ar', '', 'images/directorio/1002008106Logo V3 perfil.jpg', '', '', 0, 612, '1', '', 'images/galeria/1791343586Casa Nicolas 3 - Frente 2 Noche Sin Logo.jpg', 'images/galeria/1130944834Los Naranjos Final 0 Noche Mod.jpg', 'images/galeria/1282330513Captura.JPG', 'https://www.youtube.com/watch?v=30rbJt90xME', '2018-02-16 05:00:00', 0, '', '', '', '1', '1', '1', '1', '1', '1', '', '1', '', '', '', '', '1', 'Diseñador Gráfico y Maestro Mayor de Obras', '', '0', ''),
