(245, 'Gestiones Integrales', '', '**GESTORIA **  Mandataria Noelia Trevissan\r\nAPTO BANCO PROPIEDADES\r\n*Arba\r\n*Altas BAJAS vehiculares.\r\n*TRANSFERENCIAS,\r\n*Informes de dominio \r\n*CETA \r\n*Altas 0 km\r\n* PRENDAS\r\n*HABILITACIONES COMERCIALES\r\nInformes de dominio catastral para USUCAPION\r\n*\r\n\r\n**ABOGADOS 24 HS \r\n\r\n* Asesoramiento,\r\n*DIVORCIOS, \r\n*Alimentos,MINORIDAD Y FAMILIA,\r\n* Abogados penalistas:\r\n- EXCARCELACIONES \r\n-MALA PRAXIS\r\n-Amparos\r\n- EJECUCIONES\r\nUrgencias penales\r\n\r\nCONTADORES \r\n* AFIP, RENTAS\r\n* Monotributistas, \r\n*Asesoramiento impositivo contable integral\r\n*Sueldos\r\n*Cargas sociales,Inspecciones, atencion a empresas\r\n\r\n*Ampliaciones de planos\r\n*Remodelaciones en el hogar\r\n* INFORMES PARCELARIOS\r\n*Empadronamientos\r\n*INSTALACIONES, CONSTRUCCIÓN.\r\n\r\nTodo a su disposición.\r\nSu consulta no molesta, nos ayuda a crecer.\r\n\r\n\r\n', 'Av de Mayo 2490', 'Ramos Mejia, Buenos Aires', 'BUENOS AIRES', '1704', '1135002403', 'www.facebook.com/mandatarianoeliatrevissan/', 'QUIENES SOMOS?\r\nUn grupo de profesionales que\r\n pensamos en los problemas de los\r\n Ciudadanos y  por eso damos respuesta \r\na cada una de sus consultas, gestionamos\r\n todo tipo de trámites en Buenos Aires \r\ny en el Interior. \r\nContamos con un equipo interdisciplinario en donde  trabajan Gestores, Contadores, Arquitectos  y Asesoramiento jurídico  para realizar nuestro trabajo de manera íntegra y dentro de las  actualizaciones establecidas en nuestro actual código civil y comercial y normativas vigentes municipales, catastrales y de Dirección Nacional.\r\nSu consulta no molesta, todo lo contrario, nos ayuda a crecer. \r\nDesde ya muchas gracias. \r\n                            Saluda atentamente\r\nGestiones Integrales y Estudio juridico\r\nDra . Karina La Torre\r\nLic. Arq   Norma Trevissan \r\nGestora Noelia Trevissan \r\nDra. Lucia Gimena Molina\r\nDr. Mario Sanchez\r\n', 'noebuenosaires@yahoo.com.ar', '', 'i