(264, 'Servicio de albañileria y pintura', '', 'Les ofresemos servicios garantisados todo para el ogar albañileria,pintura,plomeria,electricidad ...con eficacia y responsabilidad', 'jose c paz ', 'jose c paz', 'BUENOS AIRES', '1665', '11271653', '', 'Nosotros realisamos todo tipo de trabajo en la construccion.\r\nel medio de pago es el 30 o 50 % del presupusto eseptado dependiendo del trabajo, luego una parte cuando el trabajo este por la mitad,y al finalizar el trabajo ofresemos nuestra garantia por algun desperfecto que presenta el trabajo sin cobro alguno.  todo se cobra por metro cuadrado', 'salomon.19.britos@gmail.com', '', 'images/directorio/552578823FB_IMG_1520070563456.jpg', '-34.4971055', '-58.76817829999999', 0, 779, '1', '', '', '', '', '', '0000-00-00 00:00:00', 0, '', '', '', '1', '1', '1', '1', '1', '1', '1', '', '', '1', '', '', '', 'secundario completo', '', '6', 'contruir salud'),
