(386, 'Venta online de Servicios y Productos', '', '\"#STUBHUB\"\r\n\r\nComprá y vendé #entradas para tus #eventos favoritos en todo el mundo.\r\n\r\nEntradas #JoanManuelSerrat\r\n\r\nPróximos #eventos en #Argentina\r\n\r\nVIE\r\nOCT 19\r\nJoan Manuel Serrat #BuenosAires\r\n20:30 - #TeatroGranRex, Buenos Aires, Argentina\r\n\r\nSÁB\r\nOCT 20\r\nJoan Manuel Serrat Buenos Aires\r\n20:30 - Teatro Gran Rex, Buenos Aires, Argentina\r\n\r\nDOM\r\nOCT 21\r\nJoan Manuel Serrat Buenos Aires\r\n20:30 - Teatro Gran Rex, Buenos Aires, Argentina\r\n\r\nMAR\r\nOCT 23\r\nJoan Manuel Serrat Buenos Aires\r\n20:30 - Teatro Gran Rex, Buenos Aires, Argentina\r\n\r\nVIE\r\nOCT 26\r\nJoan Manuel Serrat #Córdoba\r\n21:30 - #QualityEspacio, Córdoba, Argentina\r\n\r\nPróximos eventos #internacionales\r\n\r\nhttp://my.pampanetwork.com/scripts/click.php?a_aid=52c8a0ced34c2&a_bid=79481c74&desturl=https%3A%2F%2Fwww.stubhub.com.ar%2Fentradas-joan-manuel-serrat%2Fca270%3Fafl%3D1Q6X3X2YR9%26utm_source%3Dclickwise%26utm_medium%3Daffiliate%26utm_campaign%3Dhome%26utm_content%3Dlink%26affid%3D52c8a0ced34c2\r\n\r\nJoan Manuel Serrat, un clásico amado por todos\r\nVuelve a los escenarios el artista catalán que tiene conquistados a todos los corazones de habla hispana desde hace más de cincuenta años. Su cálida voz, su composiciones y sus letras, han consolidado a Joan Manuel Serrat sin lugar a dudas, como un referente de la música a nivel mundial. Su reciente gira \"Mediterraneo da Capo\" está dando vueltas por el mundo y visitará Argentina en octubre, en el Teatro Gran Rex de Buenos Aires y en Córdoba, en Quality Espacio. Si tenés la oportunidad de verlo sobre el escenario, no la podés dejar pasar. Conseguí ya tus entradas a través de StubHub y disfrutá de una emotiva velada al lado de tu ídolo.\r\n\r\nEl nuevo tour del artista incluirá además de versiones desconocidas, canciones como Lucía, Pueblo Blanco y Aquellas Pequeñas Cosas, pertenecientes a su mítico álbum \"Mediterráneo\". Este recorrido por su trayectoria no hace más que confirmar el talento de \"El Nano\", capaz de cruzar y difuminar fronteras, enamorando a su público que lo sigue fiel como el primer día.\r\n\r\nSolo y acompañado, todos éxitos\r\nJoan Manuel Serrat nació en el barrio de Poble-sec, en Barcelona y siempre fue amante de la guitarra. Su carrera musical arrancó allá por 1965, cuando pese a haberse recibido de perito industrial, se presentó a un programa de radio con sus primeras canciones. Cantautor, escritor, comporistor, trovador, actor, poeta y músico, todo eso es Serrat. Sus obras están influenciadas por grandes de la prosa como Mario Benedetti, Antonio Machado y Pablo Neruda, entre otros. Es uno de los fundadores de la corriente de la Nova Cançó catalana y su carrera ya fue reconocida con nueve doctorados Honoris Causa por su aporte s ls música y la literatura. Además recibió el Grammy Latino a \"Persona del Año\" junto con infinidad de otros reconocimientos.\r\n\r\nDestacados son su trabajos y presentaciones junto a grandes artistas como Joaquín Sabina y la gira Dos Pájaros de un Tiro y con Ana Belén, Víctor Manuel y Miguel Ríos integrando El Gusto es Nuestro. La trayectoria y el encanto de Joan Manuel Serrat ya son una marca registrada. No te quedes afuera de sus shows y comprá ya desde la comodidad de tu casa y con tan sólo un par de clicks, tus entradas en StubHub. \r\n\r\n¡Que no te lo cuenten!\r\n\r\nhttp://my.pampanetwork.com/scripts/click.php?a_aid=52c8a0ced34c2&a_bid=79481c74&desturl=https%3A%2F%2Fwww.stubhub.com.ar%2Fentradas-joan-manuel-serrat%2Fca270%3Fafl%3D1Q6X3X2YR9%26utm_source%3Dclickwise%26utm_medium%3Daffiliate%26utm_campaign%3Dhome%26utm_content%3Dlink%26affid%3D52c8a0ced34c2', 'GUAYAQUIL 568', 'BUENOS AIRES', 'CIUDAD AUTONOMA DE BUENOS AIRES', '1424', '541157196062', 'www.facebook.com/LAREVISTADELAZARO', 'VENTA ONLINE DE PRODUCTOS Y SERVICIOS', 'lazarokowiensky@gmail.com', '', 'images/directorio/86393630628379300_10155319102923202_8306618089525131197_n.jpg', '-34.