(417, 'Clases de Danzas Árabes para niñas en Quilmes - Quilmes Oeste', '', 'CLASES  DE DANZA ARABE PARA NIÑAS EN QUILMES ? ZONA SUR\r\n\r\nCLASES PARA NIÑAS ENTRE 4 Y 11 AÑOS: ESTAN ORIENTADAS A UN APRENDIZAJE DIDACTICO Y DINAMICO, ES DECIR, LA ALUMNA APRENDE MEDIANTE JUEGOS Y PREMIOS.. UTILIZAMOS ELEMENTOS DE DANZAS ARABES ASI COMO TAMBIEN OTROS OBJETOS DE LA VIDA COTIDIANA QUE AYUDAN A TRABAJAR OTROS ASPECTOS DEL GRUPO (EXPRESION, PORSTURA, DISOCIACION CORPORAL, ETC..)\r\nEl niño, a través de la actividad motriz, conoce su cuerpo, lo utiliza como medio de expresión, comienza a ser consiente de que sus extremidades pueden realizar otros movimientos que no son solamente caminar.\r\nComenzarán aprendiendo, mediante juegos, en donde se explique movimientos básicos para proceder a un trabajo de coordinación, utilizando pasos sencillos como la marcha, el salto, el aplauso, etc. Para ello, realizarán determinados ejercicios, logrando de este modo, sincronización grupal e individual, aprendiendo también, a interpretar sonidos, melodías, ritmos, marcar tiempos, etc. \r\n\r\n\r\nHORARIOS ABRIL 2018:\r\nLUNES 19 A 20 HS ? MIERCOLES 18 A 19 HS\r\n\r\nESCUELA DE DANZAS HABIB EL RUH\r\nJujuy 2967 e/ Unamuno y Elustondo- Quilmes Oeste ', 'Jujuy 2967, Quilmes Oeste', 'Quilmes Oeste', 'BUENOS AIRES', '1879', '42598893', 'www.yamilanazaralet.com', '', 'info@yamilanazaralet.com', '', 'images/directorio/136575375NIÑAS.jpg', '-34.7289837', '-58.29771470000003', 0, 956, '1', '', 'images/galeria/977315708NIÑAS.jpg', '', '', '', '0000-00-00 00:00:00', 0, '', '1', '', '', '1', '', '1', '', '', '', '', '', '', '1', '', '', 'Egresada Arabian Dance School Amir Thaleb', '', '0', '');
