(418, 'Clases de Danzas Arabes  en Quilmes - Quilmes Oeste', '', 'CICLO LECTIVO 2018 \r\nLas clases de danzas árabes comienzan el  Martes 6 de Marzo, los horarios según el nivel  y año a cursar son los siguientes:\r\n1º año: Sábados 18 hs, Miércoles 20 Hs, Viernes 11 Hs\r\n2º año: Martes 18 hs y Sábados 17 hs\r\n3º año: Martes 19 hs y Sábados 16hs\r\n4º año: Sábados 15 hs\r\n5º año: Sábados 14 hs\r\nPreparación física: Jueves 18.30 Hs\r\n\r\nESCUELA DE DANZAS HABIB EL RUH \r\n - Amplio salón de danzas - Ambiente climatizado - Cobertura médica para cada alumno - Eventos durante todo el año  - Gran Staff  de profesionales\r\n - 13 años de trayectoria nos avalan\r\n \r\n CLASES DE DANZAS ARABES:\r\n- Infantiles, juveniles y adultos \r\n- Clases grupales\r\n- Clases personalizadas \r\n- Clases con elementos \r\n- Ritmología \r\n- Material teórico y audiovisual\r\n- Programa de estudios actualizados\r\n- Seminarios y talleres con grandes maestros\r\n- Clases con músicos en vivo\r\n- Muestras anuales \r\n- Profesorado de D. Árabes - Contrataciones para Shows ? Eventos\r\n- Variedad de actividades: \r\nHIP HOP ? REGGAETON ? ZUMBA ? ZUMBA KIDS - BACHATA - PREPARACION FISICA \r\n', 'Jujuy 2967, Quilmes Oeste', 'QUILMES OESTE', 'BUENOS AIRES', '1879', '42598893', 'www.yamilanazaralet.com', '', 'yami_05_@hotmail.com', '', 'images/directorio/1327583382ARABE YAMI.jpg', '-34.728983', '-58.297799', 0, 956, '1', '', 'images/galeria/1594788422ARABE 1º AÑO.jpg', 'images/galeria/1834476861HORARIOS TARDE.jpg', 'images/galeria/9624334818920184_1344940102258318_800420523652729906_n.jpg', '', '0000-00-00 00:00:00', 0, '1', '1', '', '', '1', '1', '1', '', '1', '1', '', '', '', '1', '', '', 'Egresada Arabian Dance School Amir Thaleb', '', '0', ''),
(419, 'Clases de ZUMBA en Quilmes Oeste', '', 'CLASES DE ZUMBA EN QUILMES Y BERNAL OESTE!!!!\r\n\r\nUnite a la disciplina fitness más divertida!!\r\nMantené un cuerpo saludable, desarrollado y flexible mediante movimientos de baile combinados con una serie de rutinas aeróbicas. Es muy fácil de seguir y quemar calorías. \r\nSentí la música y liberate!!! Baila Zumba!!!\r\n\r\nINSTRUCTOR ALEXIS RAMOGNINO\r\n      -    MIERCOLES 20 HS\r\nINSTRUCTORA MAJO ROMAN\r\n-	LUNES 18 HS\r\n-	VIERNES 14 HS\r\n', 'Jujuy 2967, Quilmes Oeste', 'QUILMES OESTE', 'BUENOS AIRES', '1879', '42598893', 'www.yamilanazaralet.com', '', 'yami_05_@hotmail.com', '', 'images/directorio/1566994398ZUMBA general copia.jpg', '-34.728983', '-58.297799', 0, 956, '1', '', 'images/galeria/453752389ZUMBA ALE copia.jpg', 'images/galeria/990750593ZUMBA copia.jpg', '', '', '0000-00-00 00:00:00', 0, '1', '1', '1', '', '1', '', '1', '', '1', '', '', '', '', '1', '', '', '', '', '0', ''),
