(761, 'Taller ', '', 'Vamos que nos falta poquito para comenzar!!!  ??\r\n\r\nEl taller se enfoca principalmente en la comunicación, el lenguaje, la expresión, el intercambio con los pares, la sociabilizacion y el autoestima. Se trabajara desde el juego en equipo!!\r\nEstará coordinado por la Lic. Mosna, Vanina en psicopedagogía y en psicología la Lic. Martinez, Yamila, y la participación de nuestra fonoaudiologa Lic. Repizo, Natalia\r\n\r\nTambién se brindara un espacio para padres y madres de las chicas que asistan al taller, coordinado por las licenciadas en psicología Lic. Pucheta, Adriana y Lic. Nicolini, Victoria.\r\n\r\nPara inscribirme deben comunicarse con nosotros en forma privada por Facebook, por whatsapp al 11-69090569 o llamarnos al 0237-4055-699.', 'Dr. Vera 387', 'Moreno', 'BUENOS AIRES', '1746', '0237-4055-699', 'https://www.facebook.com/cipsi.consultorios/', '', 'cipsimoreno@hotmail.com', '', 'images/directorio/1152596791Publicacion.jpg', '', '', 0, 1390, '1', '', 'images/galeria/268736143chicas-sonrientes-jugando-con-plastilina_13339-174011.jpg', 'images/galeria/766733753nenes-alegres.jpg', '', '', '2018-04-18 05:00:00', 0, '', '1', '', '', '', '', '', '', '', '1', '', '', '', '1', '', '', '', '', '0', ''),
