(802, 'Clases de canto e interpretación', '', 'La educación funcional de la voz es la suma de un conjunto de acciones perfectamente sincronizadas que iremos descubriendo y con las que trabajaremos sobre el conocimiento muscular y postural del cuerpo e instrumento, integrando TU expresión y creatividad a través del movimiento y la presencia, para proyectar en tu Voz ya sea al cantar, recitar, hablar...\r\nEl método estriba en un entrenamiento vocal basado en el autoconocimiento, percepción, movimiento, liberación? Todo el cuerpo está involucrado!\r\n\r\nMi desafío es que puedas llegar a cantar, interpretar, recitar, hablar? ¿Existe alguna diferencia? \r\n?	¿Comunico lo que quiero comunicar?\r\n?	Cómo liberarme de ?sentir un nudo en la garganta?\r\n?	Mi voz es bonita y afinada: Cantando más allá de la ducha.\r\n?	Lo que soy capaz de hacer navegando por escalas.\r\n?	Encontrando mí poder: Cuando el silencio es mi enemigo y el gritar me quita poder.\r\n?	Hablar, cantar, comunicar? Encontrando el mensaje fundamental: ¿Qué quiero decir?\r\n', 'Ancon 5100', 'CABA', 'CIUDAD AUTONOMA DE BUENOS AIRES', '1425', '15 5468 9019', 'www.pepaluna.es', '', 'encuentrocontuvoz@gmail.com', '', 'images/directorio/664357036WhatsApp Image 2017-10-02 at 22.58.40.jpeg', '', '', 0, 1356, '1', '', 'images/galeria/565026680Afiche renovado Abril.jpeg', 'images/galeria/652163482postal.jpg', '', '', '2018-04-22 05:00:00', 0, '1', '1', '', '', '1', '', '1', '', '1', '', '', '', '1', '1', '', '', '', '', '0', ''),
