(1133, 'Energias de Luz -Terapias Holisticas- Salud, Belleza y Conoc', '', 'Energias de Luz https://www.facebook.com/marycipriano11\r\n EL16 Y 18 de Agosto Comienza el Curso de Tarot Rider Waite. Un encuentro semanal de 14.30 a 16.30 hs.\r\n Las figuras de las Cartas (Arcanos) del Tarot (Arquetipos), son un puente, entre la mente consciente e inconsciente, observando la imagen y expresando lo que nos inspira, el terapeuta y el consultante, obtendr?n de all?, much?sima informaci?n, a partir de la cual podr?n captar patrones de conducta. \r\n\r\nDel mismo modo que ?un sue?o?, la exploraci?n y el trabajo con cartas de Tarot, permite la lectura e interpretaci?n de s?mbolos, de contenidos inconscientes facilitando al terapeuta la tarea de ?darles significaci?n? y sentido.\r\n No se trata en este caso de utilizar el Tarot como una herramienta de ?adivinaci?n?, sino como un medio para poder dar pautas al consultante acerca de sus capacidades transformadoras, para avanzar en la vida. Entre las cartas y nuestro inconsciente, se establece una relaci?n, d?nde cada Arcano refleja tal como lo har?a un espejo, lo que le acontece al paciente.\r\n PROGRAMA:\r\n *Historia del Tarot. \r\n *Arcanos Mayores y Menores: descripci?n y significado de cada uno. 78 cartas en las que analizaremos las formas, figuras, colores, simbolismo de cada uno.\r\n *Combinaci?n entre los Arcanos Mayores entre s? y Mayores-Menores. Tabla comparativa.\r\n  *Pr?ctica entre los alumnos a partir de los primeros encuentros y tambien a invitados especiales (amigos, familiares, compa?eros de trabajo, etc.). Se entrega Material de Estudio y Certificado. Inversi?n $ 850 mensuales. Reserva de vacantes anticipadas (50%): Dep?sito Bancario en Banco Galicia, Caja de Ahorro n? 4022059-0 007-1 CBU 0070007830004022059012 a nombre de Maria Angelica Cipriano. Confirmar asistencia, solo diez vacantes. \r\n Esta Oportunidad es para vos !!! \r\n Es una interesante Salida Laboral. \r\n Te esperamos en Avenida Rivadavia 3400 Al