INSERT INTO `ic_faq` (`faq_id`, `l_lang`, `faq_titulo`, `faq_conten`, `faq_creacion`, `faq_categoria`) VALUES
(1, '', 'Como Hago para Registrarme Rápidamente?', '<p><span>Para registrarte, debes ir a la home y en el encabezado del lado derecho hay un bot&oacute;n que dice \"registrate\" hac&eacute; click en el bot&oacute;n y eleg&iacute; la opci&oacute;n que prefieras, registro con Facabook, con Gmail o con correo electr&oacute;nico.</span></p>', '2017-09-26', 476),
(2, '', 'Como hago para Publicar?', '<p><span>Una vez registrado, encontrar&aacute;s en diferentes partes de la web botones que dicen \"quiero publicar\" o \"public&aacute; gratis\" hac&eacute; click en esos botones y te llevar&aacute;n a la plantilla de la publicaci&oacute;n. O bien en mi cuenta hay una solapa que dice publicaciones, dentro de ella vas a encontrar un bot&oacute;n que dice \"public&aacute; un nuevo servicio\".</span></p>', '2017-09-26', 476),
(3, '', 'Cómo hacer una buena publicación?', '<p><span>Para realizar una buena publicaci&oacute;n tienes que hacer una buena descripci&oacute;n del servicio ofrecido y colocar fotos que concuerden con el servicio.</span></p>', '2017-09-26', 476),
(4, '', 'Pausar, finalizar y republicar una publicación', '<p><span>Para realizar algunas de estas acciones de tu publicaci&oacute;n, tenes que ingresar a tu cuenta y dentro del panel de publicaciones activas tendr&aacute;s estas opciones para elegir.</span></p>', '2017-09-26', 476),
(5, '', 'Modificar la publicación', '<p><span>Para modificar una publicaci&oacute;n activa, tenes que loguearte y entrar a tu cuenta, dentro del panel&nbsp; de&nbsp; publicaciones activas tendr&aacute;s la opci&oacute;n de ver todas las publicaciones y de modificar la que desees.</span></p>', '2017-09-26', 476),
(6, '', 'Publicaciones prohibidas para WorkLife', '<p><span>Worklife no permitir&aacute; publicaciones que contengan informaci&oacute;n que puedan afectar a otros usuarios, o servicios que est&eacute;n dentro del listado de publicaciones prohibidas, esto lo podes encontrar en t&eacute;rminos y condiciones (servicios prohibidos).</span></p>', '2017-09-26', 476),
(7, '', 'Resolver un problema con una publicación', '<p><span>Si tienes alg&uacute;n problema con tu publicaci&oacute;n, escribinos un correo a soporte@worklife.com, para que nosotros podamos solucionar el problema.&nbsp;</span></p>', '2017-09-26', 476),
(8, '', 'Cambiar mi clave', '<p><span>Para cambiar la contrase&ntilde;a de tu usuario, tienes que entrar a tu cuenta y vas a encontrar un bot&oacute;n que dice &ldquo;cambiar mi clave&rdquo;</span></p>', '2017-09-26', 476),
(9, '', 'Cambiar mis datos personales', '<p><span>Para cambiar cualquiera de tus datos personales, tienes que ingresar a tu cuenta y dentro de all&iacute; vas a poder visualizar todos tus datos, puedes modificar el que desees y luego haz clic en guardar.</span></p>', '2017-09-26', 476),
(10, '', 'No puedo cambiar mis datos', '<p><span>Si tienes alg&uacute;n problema con la modificaci&oacute;n de alguno de tus datos personales, escribinos un correo a&nbsp;</span><span style=\"text-decoration: underline;\"><span>soporte@hotmail.com</span></span><span>, informanos a nosotros el problema para que lo podamos solucionar.</span></p>', '2017-09-26', 476),
(11, '', 'Me olvidé la contraseña, cómo hago para recuperarla?', '<p><span>Para restablecer la contrase&ntilde;a debes ir a la home hacer click en el boton ingresar y debajo del bot&oacute;n acceder, vas a encontrar un enlace que dice \"restablecer mi password\".</span></p>', '2017-09-26', 476),
(12, '', 'Qué es y cómo funciona la calificación como Usuario Registrado?', '<p><span>La clasificaci&oacute;n de cada usuario es asignada por los usuarios que lo contactaron para realizar un trabajo. Cuanto m&aacute;s puntuaci&oacute;n consigas m&aacute;s posibilidades de que te encuentren m&aacute;s usuarios.</span></p>', '2017-09-26', 476),
(13, '', 'Cómo ser el Mejor Usuario de Worklife?', '<p><span>Para ser el mejor usuario de worklife, tienes que ser el usuario con m&aacute;s calificaciones positivas, debes tener la puntuaci&oacute;n m&aacute;s alta posible y debes hacer publicaciones con la mayor exactitud posible</span></p>', '2017-09-26', 476),
(14, '', 'Resolver un problema con una calificación u opinión', '<p><span>Si tuviste alg&uacute;n problema con un usuario escribinos a&nbsp;</span><span style=\"text-decoration: underline;\"><span>soporte@worklife.com</span></span><span>&nbsp;y contanos cu&aacute;l fue el problema para que podamos solucionarlo.</span></p>', '2017-09-26', 476),
(15, '', 'Como denunciar una publicación', '<p><span>Dentro de cada publicaci&oacute;n debajo del mapa, encontrar&aacute;s un bot&oacute;n que dice \"denunciar publicaci&oacute;n\" complet&aacute; el formulario y contanos cu&aacute;l fue el problema para que nosotros lo evaluemos.</span></p>', '2017-09-26', 476),
(16, '', 'Cuándo y cómo calificar al usuario que Contacta una publicación Activa?', '<p><span>Una vez que el usuario contactado termina el servicio, dentro de mi cuenta encontrar&aacute;s un una solapa que dice \"cotizaciones\", dentro de esta solapa va a estar la publicaci&oacute;n contactada, y en la parte baja hay un bot&oacute;n que dice \"calificar\"</span></p>', '2017-09-26', 476);
